export function getTextLength(text){
    let info = {}
    if (text) {
      info.textlength = text.length;
      info.text = text;
    }
    else {
      return null;
    } 
    info.textlength > 0  ? info.isNullorEmpty = true : info.isNullorEmpty = false;

   return info;
  }

  export function changeClass(mass, str, bool) { (bool) ?   mass.push (str): mass = mass.filter(el => el != str); return mass;}
